	const UE4CodeGen_Private::FMetaDataPairParam Z_Construct_UFunction_ULowEntryExtendedStandardLibrary_LoadVideo_Statics::Function_MetaDataParams[] = {
		{ "Category", "Low Entry|Extended Standard Library|Utilities|Video" },
		{ "Comment", "/**\n\x09* Loads a video.\n\x09* \n\x09* Requires a:\n\x09*  - MediaSoundComponent (to hear the video), this is created by using the \"Add Media Sound Component\" blueprint on an object on which you want to hear the sound on, also, don't forget to run the \"Start\" blueprint on the Media Sound Component, otherwise you won't hear anything\n\x09*  - URL (could be a HTTP/HTTPS URL, or a relative or absolute filepath, more on that below)\n\x09*  - PlayOnOpen (determines whether \"Play\" should be automatically called on the returned MediaPlayer, if this is false, the video/sound won't start until you call \"Play\" on the returned MediaPlayer yourself)\n\x09*  - Loop (determines whether the video/sound should keep playing, or whether it should just play one time and then stop)\n\x09* \n\x09* Returns a:\n\x09*  - MediaPlayer (to play/pause/etc the video)\n\x09*  - MediaTexture (to see the video)\n\x09*\n\x09* This blueprint also returns a boolean called Success.\n\x09*  - true, everything went well, every returned Object is valid\n\x09*  - false, something went wrong, every returned Object is NULL\n\x09*\n\x09* The URL is either:\n\x09*  - a HTTP/HTTPS URL, for example \"http://public.lowentry.com/files/test_data/TestVideoMp4.mp4\"\n\x09*  - a relative filepath URL of a video located in \"YourProject/Content/Movies/\" formatted like \"./Movies/YourVideo.mp4\"\n\x09*  - an absolute filepath URL of a video prefixed by \"file://\", for example \"file://C:/Program Files/Epic Games/4.13/Engine/Binaries/Win64/YourVideo.mp4\"\n\x09*\n\x09* Some tips:\n\x09*  - only MP4 (MPEG-4) can be played on every platform, so it's best to only use MP4 (MPEG-4) videos for now\n\x09*\n\x09* Additional tips:\n\x09*  - this blueprint can also be used to load sound assets, just ignore the returned Texture in that case\n\x09*  - if no MediaSoundComponent is given, or if Start wasn't called on the MediaSoundComponent, you won't hear any sound\n\x09* \n\x09* Screenshots:\n\x09*  - screenshots on how to use this blueprint correctly can be found at: https://public.lowentry.com/#files/LowEntryUE4/ue4/images/tutorials/load_video/\n\x09*/" },
		{ "CPP_Default_Loop", "true" },
		{ "CPP_Default_PlayOnOpen", "true" },
		{ "DisplayName", "Load Video" },
		{ "Keywords", "movie download audio sound" },
		{ "ModuleRelativePath", "Public/Classes/LowEntryExtendedStandardLibrary.h" },
		{ "ToolTip", "Loads a video.\n\nRequires a:\n - MediaSoundComponent (to hear the video), this is created by using the \"Add Media Sound Component\" blueprint on an object on which you want to hear the sound on, also, don't forget to run the \"Start\" blueprint on the Media Sound Component, otherwise you won't hear anything\n - URL (could be a HTTP/HTTPS URL, or a relative or absolute filepath, more on that below)\n - PlayOnOpen (determines whether \"Play\" should be automatically called on the returned MediaPlayer, if this is false, the video/sound won't start until you call \"Play\" on the returned MediaPlayer yourself)\n - Loop (determines whether the video/sound should keep playing, or whether it should just play one time and then stop)\n\nReturns a:\n - MediaPlayer (to play/pause/etc the video)\n - MediaTexture (to see the video)\n\nThis blueprint also returns a boolean called Success.\n - true, everything went well, every returned Object is valid\n - false, something went wrong, every returned Object is NULL\n\nThe URL is either:\n - a HTTP/HTTPS URL, for example \"http://public.lowentry.com/files/test_data/TestVideoMp4.mp4\"\n - a relative filepath URL of a video located in \"YourProject/Content/Movies/\" formatted like \"./Movies/YourVideo.mp4\"\n - an absolute filepath URL of a video prefixed by \"file://\", for example \"file://C:/Program Files/Epic Games/4.13/Engine/Binaries/Win64/YourVideo.mp4\"\n\nSome tips:\n - only MP4 (MPEG-4) can be played on every platform, so it's best to only use MP4 (MPEG-4) videos for now\n\nAdditional tips:\n - this blueprint can also be used to load sound assets, just ignore the returned Texture in that case\n - if no MediaSoundComponent is given, or if Start wasn't called on the MediaSoundComponent, you won't hear any sound\n\nScreenshots:\n - screenshots on how to use this blueprint correctly can be found at: https://public.lowentry.com/#files/LowEntryUE4/ue4/images/tutorials/load_video/" },
	};
